function App() {
  const [menuItems, setMenuItems] = useState(menu);

  function filterItems(target) {
    if (target === "All") {
      setMenuItems(menu);
    } else {
      var res = menu.filter(({ category }) => category.includes(target));
      setMenuItems(res);
    }
  }

  function PriceSortHandler(){

      const sortedPrices= [...menuItems].sort((a, b) => a.price - b.price);
      setMenuItems(sortedPrices);
    
  };

  function handleSearchBar(e){
    const inputVal = e.target.value.trim().toLowerCase();

    if(inputVal !=="")
    {
      var result = menu.filter(({ title }) => title.toLowerCase().includes(inputVal));
      setMenuItems(result);
      
    }
    else
    {
      setMenuItems(menu);
    }

  }

  return (
    <div className="App">

      <h1>Welcome to ABC Restaurant!</h1>

      <input type="text" placeholder="Filter with name..." onChange={handleSearchBar}></input>

      <button className="main-btn" onClick={() => filterItems("All")}>
        All
      </button>
      <button className="main-btn" onClick={() => filterItems("Breakfast")}>
        Breakfast
      </button>
      <button className="main-btn" onClick={() => filterItems("Lunch")}>
        Lunch
      </button>
      <button className="main-btn" onClick={() => filterItems("Snacks")}>
        Snacks
      </button>
      <button className="main-btn" onClick={() => filterItems("Dinner")}>
        Dinner
      </button>

<br/>

<br/>


<button className="sort-btn" onClick={PriceSortHandler}>
        Price
      </button>


      <Menu menuItems={menuItems}></Menu>
    </div>
  );
}

export default App;
